import React from 'react';

function Projects() {
  return (
    <section className="section-image" id="projects">
      <div className="img-overlay"></div>
      <div className="intro">
        <h1>Projects</h1>
        <p>Here are some of my projects...</p>
      </div>
    </section>
  );
}

export default Projects;
